tc s a b = TestCase $ assertEqual s a b

tcio s answer mio = TestLabel s $ TestCase $ do
    got <- mio
    assertEqual s answer got


-- from http://stackoverflow.com/questions/6147435/is-there-an-assertexception-in-any-of-the-haskell-test-frameworks
assertException :: (Exception e, Eq e) => e -> IO a -> IO ()
assertException ex action =
    handleJust isWanted (const $ return ()) $ do
        action
        assertFailure $ "Expected exception: " ++ show ex
  where isWanted = guard . (== ex)






buildGrid :: Int -> Int -> a -> Grid a
buildGrid r c v = G $ replicate r (replicate c v)

updateGrid :: Grid a -> Int -> Int -> a -> Grid a
updateGrid (G rows) r c v = let above = take r rows
                                below = drop (r+1) rows
                                thisrow = rows!!r
                                thisn = ((take c) thisrow)++[v]++(drop (c+1) thisrow)
                            in G $ above++[thisn]++below

blazePath :: [(Int,Int)] -> a -> Grid a -> Grid a
blazePath [] _ g = g
blazePath ((r,c):coords) v g = blazePath coords v (updateGrid g r c v)



fromTriplets :: Grid (Int,Int,Int) -> Grid RGB
fromTriplets (G rows) = G $ map (map (uncurry3 RGB)) rows

uncurry3 f (a,b,c) = f a b c

